import {Col, Table} from "react-bootstrap";

import React, {useContext, useEffect, useState} from "react";
import {observer} from "mobx-react-lite";
import {fetchRows} from "../../http/dataApi";
import {Context} from "../../index";

const Table_bamf = observer(() => {

    const {table_rows}=useContext(Context)

    const [rows, setRows] = useState([])

    const getTable = async(req, res) => {
        try{
            const response = await fetch("http://localhost:5000/rows")
            const jsonData = await response.json()

            setRows(jsonData)
        }
        catch (err){
            console.error(err.message)
        }row
    }

    useEffect(() => {
        getTable();
        fetchRows().then(data => {
            table_rows.setRows(data.rows)
            table_rows.setTotalCount(data.count)
        })
    },[])

    console.log(rows)


    return (
        <Table className="my-auto" striped bordered hover>
            <thead>
            <tr>
                <th>Date</th>
                <th>Name</th>
                <th>Count</th>
                <th>Distance</th>
            </tr>
            </thead>
            <tbody>
                {rows.map(row => (
                    <tr key={row.col_id}>
                        <td className="col-3">{row.col_date}</td>
                        <td className="col-3">{row.col_name}</td>
                        <td className="col-3">{row.col_count}</td>
                        <td className="col-3">{row.col_distance}</td>
                    </tr>
                ))}
                {/*{table_rows.map(table_row => (
                    <tr key={table_row.col_id}>
                        <td className="col-3">{table_row.col_date}</td>
                        <td className="col-3">{table_row.col_name}</td>
                        <td className="col-3">{table_row.col_count}</td>
                        <td className="col-3">{table_row.col_distance}</td>
                    </tr>
                ))}*/}
            </tbody>
        </Table>
    );
});

export default Table_bamf;
